content:
저건 데이트룩이 아니죠;;














저거는 아이돌룩이죠  
어머 웬일이야 진짜 겁나 잘생겼네  미쳐진짜

세라누나 개사이다 ㅎ
이거보는 남자는 읍나;;다 언니네
남자도 잼있는디;;

오우 작가님 마지막에 너무 좋았어요
계속 그림 해주세요
배경화면도 선물로...크흠;;

작가님 우리 남주들 얼굴은 껌이에요
&#x27;와우&#x27;

아 진짜 다 잘생기면 어쩌자는건데에ㅔ

아니.. 너가 호영이랑 형제인 줄 뭘 알고 혜원이가 너한테 말하니???;;
재영아 너 좀 많이 굴러라! 혜원이 차라리 선호나 호영이나 서브남주로 추측되는 은발 갖다 주세요...둥가둥가 우쭈쭈좀 받게 ㅠㅠ
혜원이 저렇게 무시당하고 살아야하는 애가 아닌데 ...

마지막에 코로나 저거...나만 이 대사 생각 나나...
&quot;Who are you?&quot; &quot;I&#x27;m your fairy godmother.&quot;
대충 매우 만족 한다는 댓입니닷

와아 이거 완전 재밌게 봤는데ㅎㅎ  
옛날보다 그림체가 더 이뻐지셨네용&gt;&lt;
완전 존경 합니당ㅠㅜ

왜 말을 끊어 ? 왜?
남 말 끊고 자기 할말은 다하는건 좀 그래;
빡친다
